import React , {useState} from 'react';
import {useNavigate } from 'react-router-dom'

function Services() {
  // initialize the navigator
  const navigate = useNavigate();

  // Function to navigate to Xbox Page
  const goToXboxPage = () =>{
    navigate('/Xbox');
  }
  // Function to navigate to the playstation page
  const goToPsPage =() =>{
    navigate('/Playstation');
  }
  return (
    <div>
      <h1>Customize Xbox Controller</h1>
      <button onClick={goToXboxPage}>Go to About Page</button>
      <h1>Customize Playstation Controller</h1>
      <button onClick={goToPsPage}>Go to About Page</button>
    </div>
  );
}

export default Services;
